import Language from "./Language";
import { data } from "../data/data";

function Card() {
  // console.log(data);
  return (
    <div className="card">
      <h1>Language</h1>
      <div className="langWrapper">
        {data.map((Lang, index) => (
          <Language {...Lang} key={index} />
        ))}
      </div>
    </div>
  );
}
export default Card;
